import "./App.css";
import {Route, Routes} from "react-router-dom";

const Page1 = () => {
  return (
      <div className="page">
          <h3>Page 1: About Us</h3>
          <p>We are a song shop</p>
          <div>
              <img src="https://songshop.ca/wp-content/uploads/2020/02/cropped-songShopLogo.png" alt=""/>
          </div>
      </div>
  )
}

function App() {
    return (
        <div className="App">
            <h1>
                My app
            </h1>
            <Page1/>

            <Routes>

            </Routes>
        </div>
    );
}


export default App;
